import React from 'react'
import './Pages.css'
function Pages() {
    return (
        <div className='d-flex'>
            <div className='pageIndicator'>{elem}</div>
            {
                Array(1, 2, "..", 9, 10)
                    .map(elem =>
                        <div className='pageIndicator'>{elem}</div>
                    )
            }
            <div className='pageIndicator'>{elem}</div>
        </div>
    )
}

export default Pages
